package java_programs;




class Student{
	 int id;
	 String name;
}
public class object_ClassWithin_Same_Class {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Student s1=new Student();
		s1.id=1;
		s1.name="Margi";
		System.out.println(s1.id +" "+ s1.name);
	}

}
